(1, 1, 8, 2, 'Western Dress', 'Piece', '', 10, NULL, 'MS00001', 0, NULL, 1500, 1100, 1500, 0, 100, 80, NULL, NULL, 'Western Dress', NULL, NULL, 'WesternDress', 0, 1, 2, '2021-11-25 11:09:12', '2021-11-25 11:45:16', '2021-11-25 11:45:16'),
(2, 1, 8, 2, 'Western Dress', 'Piece', '', 10, NULL, 'MS00002', 0, NULL, 1500, 1100, 1500, 0, 100, 120, NULL, NULL, 'Western Dress', NULL, NULL, 'Western-Dress', 0, 1, 2, '2021-11-25 11:45:05', '2021-11-25 11:45:21', '2021-11-25 11:45:21'),
(3, 3, 7, 14, 'womens T-shirt', 'Piece', '', 10, NULL, 'MS00002', 0, NULL, 1500, 1100, 1200, 300, 100, 120, '<div class=\"h-margin-v-default\" data-test=\"item-details-description\" style=\"box-sizing: inherit; outline: 0px; margin-top: 16px !important; margin-bottom: 16px !important; color: rgb(51, 51, 51); font-family: Targetica, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\">&nbsp;This short-sleeve T-shirt makes a versatile choice in your basics wardrobe<br>and can be styled in a variety of ways. It features a crookneck for classic style and a solid white color for effortless casual styling. <br>The regular-fit top is made from soft and breathable fabric to ensure cool comfort<br>and it has a pullover design for easy wear. Style with ankle trousers, distressed jeans or shorts to create a number of looks you\'ll love.</div>', NULL, 'womens', NULL, NULL, 'womens-T-shirt', 15, 1, 2, '2021-11-25 11:45:05', '2022-02-16 18:24:34', NULL),
(4, 1, 7, NULL, 'Women\'s Watch', 'Piece', '', 10, NULL, 'MS00004', 0, NULL, 1800, 1200, 1200, 600, 80, 80, '<p><span style=\"color: rgb(68, 68, 68); font-family: &quot;Gotham Book&quot;; font-size: 16px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial; display: inline !important; float: none;\">The case is water resistant to 100 meters and has a flat AR-coated sapphire crystal over the dial. Inside the watch is a Swiss quartz movement. The dial is kept elegant without a date window being present. The overall build quality is very good, though, for the price point, I would have liked to see diamond elements, as opposed to crystals.<br>&nbsp;It constantly stock new curren watches selections so be sure to check back often. - Imported Japan movement, high precise travel time.<br></span></p>', NULL, 'Womens-Watch', NULL, NULL, 'Womens-Watch', 12, 1, 2, '2021-11-25 11:47:12', '2022-02-16 18:24:18', NULL),
