ace: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial; display: inline !important; float: none;\">.<br>Having been awarded colours in recognition of particular achievement in some academic or sporting field. In the Commonwealth, many regimental associations wear \"regimental blazers\" which also sport a similar badge on the breast pocket, usually in the form of a wire badge, and sometimes also regimental blazer buttons.</span></li></ul>', 'bol7HmyL3W4OqU8IYvPFS2i5sJ1ZXJ7Qr2YUXVg1.pdf', 'Suit-blazer', NULL, NULL, 'Suit-blazer', 12, 1, 2, '2022-01-12 16:41:56', '2022-02-16 11:18:35', NULL),
