(252, 1, 295, NULL, 'Graphic Design', 'Piece', '', 10, NULL, 'MS00251', 0, NULL, 12000, 10000, 10000, 2000, 30, 46, '<ul><li>&nbsp;Graphic design is a craft where professionals create visual content to communicate messages. By applying visual hierarchy and page layout techniques, designers use typography and pictures to meet users\' specific needs and focus on the logic of displaying elements in interactive designs, to optimize the user experience.<br></li></ul>', NULL, 'Graphic-Design', NULL, NULL, 'Graphic-Design', 0, 1, 2, '2022-02-09 09:41:51', '2022-02-09 09:41:51', NULL),
(253, 1, 293, NULL, 'Web Design&Development', 'Piece', '', 10, NULL, 'MS00252', 0, NULL, 5000, 4500, 4500, 500, 20, 46, '<ul><li>Web design encompasses many different skills and disciplines in the production and maintenance of websites. The different areas of web design include web graphic design; user interface design (UI design); authoring, including standardised code and proprietary software; user experience design UX design.<br>And search engine optimization. Often many individuals will work in teams covering different aspects of the design process, although some designers will cover them all.[1] The term \"web design\" is normally used to describe the design process relating to the front-end (client side) design of a website including writing markup. Web design partially overlaps web engineering in the broader scope of web development.<br> Web designers are expected to have an awareness of usability and if their role involves creating markup then they are also expected to be up to date with web accessibility guidelines.<br><br></li></ul>', NULL, 'Web-DesignDevelopment', NULL, NULL, 'Web-DesignDevelopment', 0, 1, 2, '2022-02-09 09:48:20', '2022-02-09 09:48:20', NULL);
