(259, 1, 306, NULL, 'War history Books', 'Piece', '', 10, NULL, 'MS00259', 0, NULL, 700, 600, 600, 100, 50, 30, '<ul><li><span style=\"color: rgb(24, 24, 24); font-family: Merriweather, Georgia, serif; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial; display: inline !important; float: none;\">This title presents a reassessment of the Second World War, both of its origins and its prosecution. The author examines the agendas of the warring nations and offers fresh interpretations of Britain\'s own part in the war.<br></span><span style=\"color: rgb(24, 24, 24); font-family: Merriweather, Georgia, serif; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial; display: inline !important; float: none;\">Gordon Corrigan looks at the course of the Second World War from a somewhat untraditional angle, viewing it as simultaneous, large-scale conflicts, which had less in common, then we usually tend to think. The book is \"a military history\", even though the account keeps a thought-stimulating ratio of military and political aspects of the war; the former, certainly, always being in the foreground.</span><span style=\"color: rgb(24, 24, 24); font-family: Merriweather, Georgia, serif; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial; display: inline !important; float: none;\"></span></li></ul>', NULL, 'War-history-Books-', NULL, NULL, 'War-history-Books-', 0, 1, 2, '2022-02-09 10:55:39', '2022-02-09 10:55:39', NULL),
