(294, 1, 14, NULL, 'Weight Lifting', 'Piece', '', 10, NULL, 'MS00292', 0, NULL, 5000, 4500, 4500, 500, 20, 100, '<ul><li>Olympic weightlifting, a sport of lifting a weighted barbell over the head, using the snatch and clean-and-jerk styles of lifts; officially called \"weightlifting\"<br>Powerlifting, a sport consisting of three types of barbell lift: the squat, bench press, and deadlift<br>Weight training, strength training through the use of weights<br>Weightlifting (album), by The Trash Can Sinatras<br></li></ul>', NULL, 'Weight-Lifting', NULL, NULL, 'Weight-Lifting', 1, 1, 2, '2022-02-19 13:22:33', '2022-02-19 15:19:46', NULL),
(295, 3, 14, NULL, 'Upright Bike', 'Piece', '', 10, NULL, 'MS00295', 0, NULL, 1500, 1200, 1200, 300, 100, 100, '<ul><li>Upright Bike was specifically engineered for the commercial environment, from its heavy-duty steel frame to its durable powder coat paint finish. Features like built-in hand pulse sensors on the multi-position handlebars, as well as the easy-to-read console with a variety builtin programs, satisfy casual and committed users alike. The extra-smooth ride comes from the perfected gearing and the integrated generator/flywheel system.<br></li></ul>', NULL, 'Upright-Bike', NULL, NULL, 'Upright-Bike', 1, 1, 2, '2022-02-19 13:24:57', '2022-02-19 15:19:48', NULL),
(296, 1, 14, NULL, 'Steel Weight lifting', 'Piece', '', 10, NULL, 'MS00296', 0, NULL, 2500, 2400, 2400, 100, 20, 100, '<ul><li>Good quality and low price: Our mold uses advanced technology and uses high-quality silicon, durable and has a high cost performance. Easy to use: You only need to put any elements you like into the silicone resin mold, such as the gold foil, put it into the mold and wait for a moment to cure, you can easily take it out and decorate it according to your preferences.<br>Environmentally friendly and reusable: Because of its unique material, it can be reused many times. After use, wash and dry the mold, and then it can be used next time.Wide Application: You can use it to decorate keychains and make jewelry, or you can use it to make home decorations. Easy demolding: This mold is made of silicone material, which is very convenient for demolding.<br></li></ul>', NULL, 'Steel-Weight-lifting', NULL, NULL, 'Steel-Weight-lifting', 1, 1, 2, '2022-02-19 13:27:22', '2022-02-19 15:19:50', NULL);
