(297, 1, 14, NULL, 'Metal Dumbbells', 'Piece', '', 10, NULL, 'MS00296', 0, NULL, 5000, 4500, 4500, 500, 100, 100, '<p><span style=\"color: rgb(15, 17, 17); font-family: Arial, sans-serif; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial; display: inline !important; float: none;\">Keeping the diverse requirements of customers in mind, we are instrumental in providing Iron Dumbbell. Keeping the diverse requirements of customers in mind, we are instrumental in providing Iron Dumbbell. <br>These products are stringently examined on numerous quality parameters before final dispatch. These products are known for their remarkable quality and finish.</span><span style=\"color: rgb(15, 17, 17); font-family: Arial, sans-serif; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial; display: inline !important; float: none;\">Threaded ends with star-lock collars provide a safe, secure workout &amp; easy weight plate changes</span><span style=\"color: rgb(15, 17, 17); font-family: Arial, sans-serif; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial; display: inline !important; float: none;\"></span></p>', NULL, 'Metal-Dumbbells', NULL, NULL, 'Metal-Dumbbells', 1, 1, 2, '2022-02-19 13:29:17', '2022-02-19 15:19:51', NULL),
(298, 1, 14, NULL, 'Rowing Machine', 'Piece', '', 10, NULL, 'MS00296', 0, NULL, 6000, 5500, 5500, 500, 25, 100, 'The rower is basically the horizontal version of the deadlift and uses similar muscles,\" says Creighton. \"On the drive, the main focus is on The rower is basically the horizontal version of the deadlift and uses similar muscles,\" says Creighton. \"On the drive, the main focus is on the posterior chain—the hamstrings, glutes, calves, and spinal erectors are all being used. In the pull, the quads, forearms, biceps, and lats are used as well.&nbsp;&nbsp;&nbsp; <br>', NULL, 'Rowing-Machine', NULL, NULL, 'Rowing-Machine', 1, 1, 2, '2022-02-19 13:30:41', '2022-02-19 15:19:53', NULL),
(299, 3, 14, NULL, 'Dumbbells Berbells', 'Piece', '', 10, NULL, 'MS00296', 0, NULL, 7500, 6500, 7000, 500, 5, 200, '<ul><li>&nbsp;The Marble Dumbbells is the most stylish of all Gym accessories. They are also perfect for use as a paper weight or functional sculpture in the home or studio.The marble dumbbells give an elegant style when exercising. We also love not having to store them and use them as decorative items or functional sculptures <br></li></ul>', NULL, 'Dumbbells-Berbells', NULL, NULL, 'Dumbbells-Berbells', 1, 1, 2, '2022-02-19 13:33:31', '2022-02-19 15:19:54', NULL),
(300, 5, 14, NULL, 'Elliptical machine', 'Piece', '', 10, NULL, 'MS00296', 0, NULL, 9000, 8000, 8000, 1000, 50, 30, '<ul><li>An elliptical trainer or cross-trainer is a stationary exercise machine used to stair climb, walk, or run without causing excessive pressure to the joints, hence decreasing the risk of impact injuries.[citation needed] For this reason, people with some injuries can use an elliptical to stay fit, as the low impact affects them little. Elliptical trainers offer a non-impact cardiovascular workout that can vary from light to high intensity based on the speed of the exercise and the resistance preference set by the user.<br></li></ul>', NULL, 'Elliptical-machine', NULL, NULL, 'Elliptical-machine', 1, 1, 2, '2022-02-19 13:35:05', '2022-02-19 15:19:56', NULL),
(301, 5, 14, NULL, 'Hack squat machine', 'Piece', '', 10, NULL, 'MS00296', 0, NULL, 3800, 2600, 3600, 200, 50, 100, '<p><span style=\"color: rgb(32, 33, 36); font-family: arial, sans-serif; font-size: 16px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial; display: inline !important; float: none;\">Step into the machine, placing your feet shoulder-width apart and your shoulders and back against the pads. Release the safety handles, inhale, and lower down, bending your knees until they reach a 90-degree angle. Pause here, then push up through the back of your feet to extend your legs back to the starting position.</span></p>', NULL, 'Hack-squat-machine', NULL, NULL, 'Hack-squat-machine', 1, 1, 2, '2022-02-19 13:37:19', '2022-02-19 15:19:57', NULL),
(302, 5, 15, NULL, 'Leather Heel', 'Piece', '', 10, NULL, 'MS00302', 0, NULL, 5000, 4500, 4500, 500, 20, 50, '<ul><li>&nbsp;Many of the On shoes below have been through our extensive testing process. That means getting each model on the feet of our team of over 350 avid runners, who then put at least 100 miles on the shoe before providing their feedback. As our test team and staff report their on-foot impressions, we also run a battery of mechanical tests in our RW Shoe Lab, where we measure everything from the energy return of On’s Speedboard midsoles to the softness of its Helion foam. <br></li></ul>', NULL, 'Leather-Heel-', NULL, NULL, 'Leather-Heel-', 1, 1, 2, '2022-02-19 14:55:50', '2022-02-19 15:15:14', NULL),
(303, 1, 15, NULL, 'Leather Sneaker', 'Piece', '', 10, NULL, 'MS00302', 0, NULL, 1500, 1400, 1400, 100, 50, 100, '<ul><li>Bata sneakers have become an essential element of every man’s casual wardrobe. These sublime shoes offer a level of style, minimal design, versatility, &amp; comfort that other casual shoes just can’t match at this price. The unfussy sophistication of this sneaker is appreciated by everybody! FEATURES: - Type: Casual Sneaker - Gender: Men - Upper Material: PU - Color: White - Sole: TPR - Closing: Closed STYLE TIPS: Match them with a pair of jeans for an elegant casual look or dress them up with a suit for a business casual style.<br></li></ul>', NULL, 'Leather-Sneaker', NULL, NULL, 'Leather-Sneaker', 1, 1, 2, '2022-02-19 14:58:34', '2022-02-19 15:15:16', NULL),
(304, 5, 15, NULL, 'stylish Converse', 'Piece', '', 10, NULL, 'MS00302', 0, NULL, 2500, 2400, 2400, 100, 20, 200, '<ul><li>&nbsp;Stylish convers&nbsp; shoe have become an essential element of every man’s casual wardrobe. These sublime shoes offer a level of style, minimal design, versatility, &amp; comfort that other casual shoes just can’t match at this price. The unfussy sophistication of this sneaker is so good for use.<br></li></ul>', NULL, 'stylish-Converse', NULL, NULL, 'stylish-Converse', 1, 1, 2, '2022-02-19 15:01:48', '2022-02-19 15:15:20', NULL),
(305, 5, 15, NULL, 'Sports Shoe', 'Piece', '', 10, NULL, 'MS00302', 0, NULL, 450, 400, 400, 50, 20, 100, '<ul><li>&nbsp;Many of the On shoes below have been through our extensive testing process. That means getting each model on the feet of our team of over 350 avid runners, who then put at least 100 miles on the shoe before providing their feedback. As our test team and staff report their on-foot impressions, we also run a battery of mechanical tests in our RW Shoe Lab, where we measure everything from the energy return of On’s Speedboard midsoles to the softness of its Helion foam. <br></li></ul>', NULL, 'Sports-Shoe', NULL, NULL, 'Sports-Shoe', 1, 1, 2, '2022-02-19 15:06:36', '2022-02-19 15:15:22', NULL),
(306, 1, 15, NULL, 'Pencil Heel', 'Piece', '', 10, NULL, 'MS00303', 0, NULL, 5600, 3500, 4100, 1500, 20, 100, '<ul><li>This heel shoes perfect for the smart and stylish women.The attractive and fashionable heel shoe made from&nbsp;&nbsp; pu-leather.Which is very comfortable to wear for different social and cultural.Functions and the heel shoes will definitely make you smart and stylish look.The regular-fit top is made from soft and breathable fabric to ensure cool comfor&nbsp;&nbsp; and it has a pullover design for easy wear. Style with ankle trousers, distressed jeans or shorts to create a number of looks you\'ll love.<br></li></ul>', NULL, 'Pencil-Heel-', NULL, NULL, 'Pencil-Heel', 1, 1, 2, '2022-02-19 15:11:05', '2022-02-19 15:17:37', NULL),
